import React, { Component } from 'react';
import './App.css';

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>GitHub Issue Viewer</h1>
          <input type="text" name="search" placeholder="Paste repo URL"/>

        </header>
      </div>
    );
  }
}
